  PARITY_AlreadyImported: "(parity-01) A transaction with the same hash was already imported. It was probably already broadcast. To avoid duplicate transactions, check your address on [etherscan.io](https://etherscan.io) & wait 10 minutes before attempting to send again. [Learn More.](https://support.wallet.elaeth.io/transactions/transactions-not-showing-or-pending.html)",
  PARITY_GasLimitExceeded: "(parity-02) Transaction cost exceeds current gas limit. Limit: (d+), got: (d+). Please lower the gas limit to 21000 (for sending) or 200000 (for sending tokens or contracts) and try again. [Learn More](https://support.wallet.elaeth.io/gas/what-is-gas-ethereum.html)",
  PARITY_InsufficientBalance: "(parity-03) Insufficient balance. The account you tried to send transaction from does not have enough funds. If you believe this is in error, try using the 'Send Entire Balance' button, or pressing generate again. Required (d+) and got: (d+). [Learn More.](https://support.wallet.elaeth.io/transactions/transactions-not-showing-or-pending.html)",
