  PARITY_InvalidGasLimit: "(parity-05) Supplied gas limit is beyond limit. Try lowering the gas limit to 21000. [Learn More.](https://support.wallet.elaeth.io/gas/what-is-gas-ethereum.html)",
  PARITY_LimitReached: "(parity-06) There are too many transactions in the queue. Your transaction was dropped due to limit. Try increasing the gas price. [Learn More.](https://support.wallet.elaeth.io/transactions/transactions-not-showing-or-pending.html)",
  PARITY_Old: "(parity-07) There is already a transaction with this [nonce](https://support.wallet.elaeth.io/transactions/what-is-nonce.html). Try incrementing the nonce by pressing the Generate button again, or [replace the pending transaction](https://support.wallet.elaeth.io/transactions/check-status-of-ethereum-transaction.html).",
